eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"reviews\": () => (/* binding */ reviews)\n/* harmony export */ });\nconst reviews = [\n    {\n        id: 1,\n        fullName: \"Артём Казанцевич\",\n        image: \"/images/customers/Artem.jpg\",\n        address: \"Москва\",\n        rewiew: \"Спартаковские \\xabстеночки\\xbb, игра на третьего, взрывные контратаки, все что я так любил в Спартаке Романцева вижу на тренировках своих детей. Помимо тренировок выделяю общую организацию. Взять тот же кабинет родителя с инструкциями и видео развивающими. Классный проект, что тут ещё скажешь.\"\n    },\n    {\n        id: 2,\n        fullName: \"Лена Воробьева\",\n        image: \"/images/customers/Lena.jpg\",\n        address: \"Москва\",\n        rewiew: \"На тренировках все в одинаковой форме, все занятия под чутким руководством двух профессиональных тренеров, очень классный подход в целом. Если у меня есть вопрос я всегда его могу задать тренеру напрямую по окончанию занятия, это помогает мне с сыном на одной волне находиться!)\"\n    },\n    {\n        id: 3,\n        fullName: \"Егор Крипин\",\n        image: \"/images/customers/Egor.jpg\",\n        address: \"Москва\",\n        rewiew: \"Считаю, что школа Спартак отличная возможность помочь ребёнку с реализацией его мечты - стать футболистом. Даже невооружённым взглядом видно, что тренировки проходят на абсолютно ином уровне, нежели в ДЮСШ. Организация, дисциплина, да и подход к ребятам - в целом, все в разы серьёзнее и интереснее.\"\n    },\n    {\n        id: 4,\n        fullName: \"Анна Давыдова\",\n        image: \"/images/customers/Anna.jpg\",\n        address: \"Москва\",\n        rewiew: \"Добрый вечер !!! Хочется сказать огромное спасибо всем тренерам футбольной школы за прекрасное отношение к детям, поход к каждому малышу свой, что очень порадовало. Сынуля в восторге, и это главное. Спасибо вам большое. Ходим к вам с большим удовольствием, и будем продолжать ходить.\"\n    },\n    {\n        id: 5,\n        fullName: \"Диана С.\",\n        image: \"/images/customers/Diana.jpg\",\n        address: \"Москва\",\n        rewiew: \"Добрый день! Мы остались в диком восторге от первой тренировки! от отношения тренеров к детям, от подхода! Спасибо! Мы безумно довольны Станиславом! Строгий, но очень справедливый! Уделяет внимание каждому ребёнку! Очень нравится то что Стас относится к каждому ребёнку, как к Личности и понимает каждого из маленьких чемпионов! Стас спасибо Вам!\"\n    },\n    {\n        id: 6,\n        fullName: \"Евгения\",\n        image: \"/images/customers/Evgenia.jpg\",\n        address: \"Москва\",\n        rewiew: \"Мы очень довольны, что как-то решили придти на пробное бесплатное занятие. И остались очень довольны! Занимаемся уже третий месяц, правда только по субботам, в другое время не получается водить ( что очень жаль! Ребенку все нравиться! Тренера хорошие, на одной волне с детьми! Особенно нам по душе дует в составе Галя и Денис!!!\"\n    },\n    {\n        id: 7,\n        fullName: \"Елена Иванова\",\n        image: \"/images/customers/Elena.jpg\",\n        address: \"Москва\",\n        rewiew: \"Спасибо тренерам: Александру Юрьевичу, Юрию Сергеевичу за прекрасную подготовку команды, Валерии и Денису за организацию и поддержку ребят и родителей! Вы подарили незабываемые эмоции и счастье нашим маленьким футболистам!!!\"\n    },\n    {\n        id: 8,\n        fullName: \"Татьяна Серовская\",\n        image: \"/images/customers/Tatyana.jpg\",\n        address: \"Москва\",\n        rewiew: \"Хочу выразить огромную благодарность за спортивное воспитание наших детей, нашему самому лучшему тренеру Старовойту Станиславу Васильевичу! С ним дети живут футболом и двигаются только к БОЛЬШИМ ПОБЕДАМ! Нашего тренера ни за что не променяем ни на какого другого!\"\n    },\n    {\n        id: 9,\n        fullName: \"Игорь Г.\",\n        image: \"/images/customers/Igor.jpg\",\n        address: \"Москва\",\n        rewiew: \"Хочу ещё раз выразить благодарность организаторам турнира - и лично Сергею Александровичу Ивашову! Даже не представляю сколько сил, терпения, переживаний было вложено, чтобы у нас была возможность насладиться этим поистине футбольным праздником!!! Спасибо нашим тренерам за заботу о наших футболистах, поддержку и настрой на играх!!! Спасибо болельщикам за неистовую поддержку ребят, эти эмоции вдохновляли на победы! Ведь вряд ли будешь также болеть за кого-то ещё :) Голос был сорван, 2 дня хрипели \\uD83D\\uDE02 Спасибо соперникам за хорошую игру и эмоции! Спасибо судьям за качественную и грамотную работу! Спасибо главному судье соревнований Илье Борисовичу за крутой календарь и организацию матчей! Детки успевали поесть, раскраситься, отдохнуть и снова в бой! Спасибо волонтёрам за помощь в создании и поддержании атмосферы праздника! Спасибо всем причастным (спонсорам, оператору, фотографу, ведущему всем кого забыл упомянуть)!!! Очень понравилось! Хотим ещё!!! \\uD83D\\uDC4D\"\n    },\n    {\n        id: 10,\n        fullName: \"Анжела\",\n        image: \"/images/customers/Angela.jpg\",\n        address: \"Москва\",\n        rewiew: \"Ребенок очень доволен. А если доволен ребенок, то довольны и родители. Сегодня у нас стартовали летние футбольные сборы на базе нашей школы. Фотоотчет родителям постоянный - дабы не переживали и знали, чем заняты дети. Тренера у нас хоть и молодые (Алексей Владимирович Тришин / Алексей Викторович Никульшин), но очень квалифицированные (авторитет у детей имеют). Руководитель школы очень внимательный, отзывчивый, всегда с удовольствием отвечающий на множественные вопросы родителей (а мы порой задаем глупые вопросы по незнанию). Осмелюсь от лица всех родителей нашей школы ВЫРАЗИТЬ БЛАГОДАРНОСТЬ нашим тренерам и руководителю просто за то, что Вы у нас есть!!!\"\n    },\n    {\n        id: 11,\n        fullName: \"Кулаков Дмитрий\",\n        image: \"/images/customers/Dima.jpg\",\n        address: \"Москва\",\n        rewiew: \"Очень доволен, как организован тренировочный процесс в нашей школе. Занятия проходят на высоком уровне. Задания, которые дает наш тренер в достаточной степени сложные, но интересные, дети с удовольствием и старанием их выполняют. Мы ходим четыре с небольшим месяца, но двух одинаковых тренировок еще не было. Очень нравиться, что тренер помнит всех по именам, одинаково внимательно, но требовательно относиться к каждому. Ребята вовлечены и в процесс подготовки заданий на тренировке: помогают с расстановкой и уборкой инвентаря. Нам (подчеркну, что именно нам - родителям) эти тренировки тоже очень полезны, есть возможность посмотреть на свое чадо со стороны, оценить что так, а что нет делаем мы сами. Спасибо ребятам!!!\"\n    },\n    {\n        id: 12,\n        fullName: \"Ольга\",\n        image: \"/images/customers/Olga.jpg\",\n        address: \"Москва\",\n        rewiew: \"Выражаю благодарность нашему тренеру Кучеренко Дмитрию в заслуженной победе команды и моего сына Фурсова Тимофея, занявших 1-ое место в турнире по футболу, проходившем 20-21 октября 2019 года. Желаю ребятам усердно заниматься футболом, хорошо проявлять себя на филиальных турнирах и прибавлять в мастерстве. Тренеру успехов в развитии индивидуальности юных футболистов, качественных тренировок и поддержании заинтересованности в игре. Отдельное спасибо организатору Кучеренко Александре!\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./features/app/UI/Reviews/const.ts\n");

